import React from 'react';
import { render } from "react-dom";
import styles from "./style/taskStyle.module.css";
import { View, Image, StyleSheet } from "react-native";
import ElementBar from './elementBar';

import Cover from "./img/cover.jpg";
import Blue from "./img/stimuli3_blue.jpg";
import Red from "./img/stimuli3_red.jpg";
import Green from "./img/stimuli3_green.jpg";
import Yellow from "./img/stimuli3_yellow.jpg";
import Hello from "./Hello";

import "./style/barstyles.css";

class ElementsTraining extends React.Component{

    state = {
      img1: Cover,
      img2: Cover,
      img3: Cover,
      progress: 10
    };

    // componentDidMount() {
    //     setInterval(() => {
    //       this.setState(prevState => ({
    //         progress:
    //           (prevState.progress + Math.floor(Math.random() * 20) + 1) % 100
    //       }));
    //     }, 1000);
    //   }

    render() {
      return (<div className={styles.cockpit}>
        <div className={styles.main}>
        <span className={styles.centerTwo}>
        <View style={styles.container}>
          <View style = {styles.backgroundContainer}>
          <View style={styles.container}>
            <img className={styles.elementsize }
              src={this.state.img1}
              onMouseEnter={() => {
                this.setState({
                  img1: Blue
                });
              }}

              onMouseOut={() => {
                this.setState({
                  img1: Cover
                });
              }}
            />
             </View>
             <View style = {styles.overlay}>

        <div className="App">
            <ElementBar progress={this.state.progress} />
             </div>
</View>


             </View>








        </View>
            &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <img className={styles.elementsize }
                src={this.state.img2}
                onMouseEnter={() => {
                  this.setState({
                    img2: Red
                  });
                }}
                onMouseOut={() => {
                  this.setState({
                    img2: Cover
                            });
                          }}
                        />
                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                        <img className={styles.elementsize }
                                      src={this.state.img3}
                                      onMouseEnter={() => {
                                        this.setState({
                                          img3:
                                            Yellow
                                        });
                                      }}
                                      onMouseOut={() => {
                                        this.setState({
                                          img3: Cover
                                        });
                                      }}
                                    />
                                    </span>
                                  </div>
     </div>

      );
    }
  }
  //
  var styles2 = StyleSheet.create({
  backgroundContainer: {
    position: 'absolute',
    top: 0,
    bottom: 0,
    left: 0,
    right: 0,
  },
  container: {
    flex: 1,
    alignItems: 'center',
  },
  overlay: {
    opacity: 0.5,
    backgroundColor: '#000000'
  },
  logo: {
    backgroundColor: 'rgba(0,0,0,0)',
    width: 160,
    height: 52
  },
  backdrop: {
    flex:1,
    flexDirection: 'column'
  },
  headline: {
    fontSize: 18,
    textAlign: 'center',
    backgroundColor: 'black',
    color: 'white'
  }
});

render(<ElementsTraining />, document.getElementById("root"));

const rootElement = document.getElementById("root");

export default ElementsTraining;
